// Admin.js
import React from 'react';

function Admin({ generateDiscountCode, adminValues }) {
  const { totalProducts, totalCost, discountApplied, discountedPrice } = adminValues;

  return (
    <div>
      <h3>Admin Panel</h3>
      <button onClick={generateDiscountCode}>Generate Discount Code</button>
      <div>
        <h4>Total Products: {totalProducts}</h4>
        <h4>Total Cost: ${totalCost.toFixed(2)}</h4>
        <h4>Discount Applied: {discountApplied}</h4>
        <h4>New Discounted Price: ${discountedPrice.toFixed(2)}</h4>
      </div>
    </div>
  );
}

export default Admin;
